CREATE DEFINER=`root`@`localhost` PROCEDURE `agent_request` (IN `query_type` VARCHAR(30), IN `_name` VARCHAR(30), IN `_phone_no` VARCHAR(15), IN `_email` VARCHAR(60), IN `_address` VARCHAR(100), IN `_picture` LONGTEXT, IN `_phase_id` VARCHAR(10), IN `_user_id` INT(6))   BEGIN
    DECLARE _agent_id INT(6);
