       SELECT id INTO _agent_id FROM agents WHERE email=_email or phone_no = _phone_no;
        IF _agent_id > 0 THEN
            UPDATE plaza_phases set agent_id = _agent_id WHERE id = _phase_id;
        ELSE
        START TRANSACTION;
            INSERT INTO agents(name,phone_no,email,address,picture,user_id)		
            VALUES (_name,_phone_no,_email,_address,_picture,_user_id);
            SELECT LAST_INSERT_ID() INTO _agent_id;
            UPDATE plaza_phases set agent_id = _agent_id WHERE id = _phase_id;
        COMMIT;
     END IF;
    ELSEIF query_type ='select-all' THEN
    	SELECT a.id, a.name, a.phone_no, a.email, a.address, a.picture,(SELECT COUNT(id) FROM plaza_phases x WHERE x.agent_id= a.id) FROM agents a;
    ELSEIF query_type ='select-one' THEN
   SELECT a.id, a.name, a.phone_no, a.email, a.address, a.picture,(SELECT COUNT(id) FROM plaza_phases x WHERE x.agent_id= a.id) FROM agents a WHERE a.id = _user_id;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `plaza_phases` (IN `query_type` VARCHAR(30), IN `_id` INT(8), IN `_name` VARCHAR(30), IN `_code` VARCHAR(8), IN `_no_of_shops` INT(4), IN `_rent_fee` DOUBLE, IN `_rent_start_date` DATE, IN `_rent_end_date` DATE, IN `_plaza_id` INT(4), IN `_agent_id` INT(6))  DETERMINISTIC BEGIN
    DECLARE _shop_counts ,i, last_shop, _phase_id INT;
    DECLARE _plaza_code VARCHAR(20);
    
    IF query_type = 'create' THEN
        INSERT INTO `plaza_phases` (`name`, `code`, `no_of_shops`, `rent_fee`, `rent_start_date`, `rent_end_date`, `plaza_id`) 
        VALUES (_name,_code,_no_of_shops,_rent_fee,_rent_start_date,_rent_end_date,_plaza_id);
      IF _no_of_shops > 0 THEN
        SELECT COUNT(code) INTO _shop_counts from `shops` WHERE code LIKE CONCAT(_code,'%');
        SET last_shop = _shop_counts+ CAST(_no_of_shops AS INT);
        SELECT LAST_INSERT_ID() INTO _phase_id;
        BEGIN
            SET i =  _shop_counts +1;
            WHILE (i <= last_shop) DO
                INSERT INTO `shops` (name, code, rent_fee, rent_start_date, rent_end_date, phase_id) 
                VALUES (_name, CONCAT(_code,'-',i), _rent_fee, _rent_start_date, _rent_end_date, _phase_id);
                SET i = i+1;
            END WHILE;
        END;
     END IF;
    ELSEIF query_type = 'update' THEN
    	UPDATE `shop_allocation` SET `customer_id`=_customer_id,`name`=_name,`amount_paid`=_amount_paid,`shop_id`=_shop_id,`year`=_year,`status`=_status,`description`=_description WHERE id=_id;
    ELSEIF query_type = 'select-all' THEN
        SELECT * FROM `plaza_phases`;
    ELSEIF query_type = 'select-agent' THEN
        SELECT p.*,(select pl.name  FROM plazas pl where pl.id = p.plaza_id) as plaza_name  FROM `plaza_phases` p WHERE agent_id=_agent_id;
    ELSEIF query_type = 'select-one' THEN
        SELECT * FROM `plaza_phases` WHERE id=_id;
 ELSEIF query_type = 'list-by-plaza' THEN
       SELECT *  FROM plaza_phases_view p WHERE p.plaza_id = _plaza_id ;
    END IF;
END$$

